import { useEffect, useState } from "react";
import CameraListItem from "./CameraListItem";

function Users(props) {
  const [cameraList, setCameraList] = useState(undefined);

  useEffect(() => {
    const x = async () => {
      await new Promise((r) => setTimeout(r, 1000));
      setCameraList([
        {
          cameraName: "מצלמה 1",
          thumbnailURI: "image/octet-stream",
          thumbnailData:
            "",
        },
        {
          cameraName: "מצלמה 2",
          thumbnailURI: "image/jpeg",
          thumbnailData:
            "",
        },
      ]);
    };

    x();
  });

  return (
    <div className="d-flex flex-column" style={{ margin: "60px" }}>
      <p style={{ fontSize: "1.7em", fontWeight: "700" }}>מצלמות</p>
      <div className="d-flex flex-row">
        {cameraList !== undefined ? (
          cameraList.length > 0 ? (
            cameraList.map((camera) => (
              <CameraListItem
                key={camera.cameraName}
                name={camera.cameraName}
                thumbnailData={camera.thumbnailData}
                thumbnailURI={camera.thumbnailURI}
              />
            ))
          ) : (
            <p>אין מצלמות פעילות</p>
          )
        ) : (
          <p>טוען מצלמות...</p>
        )}
      </div>
    </div>
  );
}

export default Users;
